import React, { Component } from 'react';
import './css/Home.css';

export class Home extends Component {

    render() {

        

        return (
            <div className="home">

                {this.props.items.phones.slice(0,3).map((brand,price) =>{
                    return <div>
                    <h6>{brand.brand}</h6>
                    <h6>{price.price}</h6>
                    </div>
                })}

            </div>

        )
    }
}

export default Home;
